import React from 'react'
import Login from './Login'
import Logout from './Logout'
import Logo from "../img/logo.png";
import Menu from "../img/menu-alt.png";
import NavBar from './NavBar'
import Contact from './Contact';

export default class NavigationPanel extends React.Component {
  render() {
    const { home, login, logout, signup, signin, contact, isConnected } = this.props;

    return <nav id="navPanel">
      <NavBar/>
      {!isConnected && <p>
        <button className="Sign" onClick={() => { signup(); }}>Se connecter</button>
        <button className="Sign" onClick={() => { signin(); }}>S'inscrire</button>
      </p>}
    </nav>;
  }
}
